import "./ChartBar.css";

const ChartBar = (chartProps) => {
  let barFillHeight = "0%";
  if (chartProps.max > 0) {
    barFillHeight = Math.round((chartProps.value / chartProps.max) * 100) + "%";
  }
};

export default ChartBar;
